У програмі "Патруль" ви знайдете необхідні повсякденні нормативні акти, екстрені телефони, пам'ятки та багато іншого. Буде корисною у нагоді як пересічному громадянину так і поліцейському чи військовому.

Додаток містить у собі наступну інформацію:
- Конституція України;
- Правила дорожнього руху України;
- Кодекси;
- Закони України;
- Накази МВС;
- Штрафи;
- Екстренний телефонний довідник;
та багато іншого!

Платні підписки
¯¯¯¯¯¯¯¯¯¯¯¯¯¯
Патруль є "відносно" безкоштовною програмою (freemium), мається на увазі, що деякий функціонал доступний за умовою платної підписки, а саме - відсутність реклами, постійні оновлення, пошук по сторінці, закладки тексту.

Ви маєте змогу спробувати 7 днів безкоштовного користування та переглянути як працює програма з повним функціоналом. Після закінчення пробного 7-дневного періоду, оплата за користування буде наступною:
1 місяць - $1.99

Ви також маєте змогу підписатись на 1 рік, вартість такої підписки - $19.99 (12 місяців)


